    "2016-02-04T05:17:53.700723",nt"name": "somerville-middle-school-yrbs-raw-data-2003-2015",nt"isopen":
    true,nt"url": null,nt"notes": "The City of Somerville conducts the Youth
    Risk Behavior Survey each year to gather data about students' risk behaviors. On
    an annual basis, Health & Human Services staff coordinate a survey with either High
    School or Middle School students in alternating years.rnrnThe data presented in
    this table is from middle school students from 2003 through 2015 and includes questions
    about tobacco use, alcohol and other drug use, sexual behaviors that might lead
    to unintended pregnancy or sexually transmitted disease, dietary behaviors, physical
    activity, and behaviors associated with intentional or unintentional injuries. Data
    from the YRBS provide accurate estimates of the prevalence of risk behaviors among
    public school students in the City, and are important for planning health education
    and risk prevention programs.rnrnAttached is the questionnaire used in the survey
    which includes information regarding the variables used in the dataset.",nt"license_title":
